import Nb from './components/nb.js';
import Routes from './Routes';
import Doc from './pdf';

export default class App extends Component {
  render() {
    const { pageNumber,numPages } = this.state;
    return (
      <html>
        <header>
          <div id="top">
            <h1>Brad Kaes</h1>
            <p>Please Hire Me</p>
          </div>
        </header>
        <Nb></Nb>
        <Routes />
        <footer>Bottom</footer> 
      </html>
    );
  }
}
